import React, { useState, useEffect } from 'react';
import s from './Announcement.module.css';
import { useTranslation } from 'react-i18next';
import logoPhone from '../../images/Phonetel.png';
import usedTent from '../../images/usedTent.png';
import { useNavigate } from 'react-router-dom';
import css from '../usedTents/UsedTents.module.css';

const Announcement = ({ id = 5 }) => {
  const { t } = useTranslation();
  const [tent, setTent] = useState(null);
  const [relatedTents, setRelatedTents] = useState([]);

  const navigate = useNavigate();

  useEffect(() => {
    // Fetch the main announcement data
    fetch(`${process.env.REACT_APP_API_URL}/tents/${id}`)
      .then(response => response.json())
      .then(data => setTent(data))
      .catch(error => console.error('Error fetching tent:', error));

    // Fetch the related ads data
    fetch(`${process.env.REACT_APP_API_URL}/tents`)
      .then(response => response.json())
      .then(data => setRelatedTents(data.slice(0, 4)))
      .catch(error => console.error('Error fetching related tents:', error));
  }, [id]);

  const handleClick = () => {
    navigate('/used-tents');
  };

  if (!tent) {
    return <div>Loading...</div>;
  }

  const { title, createdAt, description, location, owner, price, photo } = tent;

  return (
    <div className={s.announSection}>
      <h2 className={s.title}>{t('announcement')}</h2>
      <div className={s.annoucementWrapper}>
        <div className={s.imageBox}>
          <img className={s.image} src={`${process.env.REACT_APP_API_URL}${photo}`} alt={title} />
        </div>
        <div className={s.description}>
          <h3 className={s.descTitle}>{title}</h3>
          <p className={s.desciption}>{description}</p>
        </div>
        <div className={s.ownerWrapper}>
          <p className={s.price}>{price} грн</p>
          <p className={s.owner}>{owner}</p>
          <p className={s.tell}>+380501589860</p>
          <a href="tel:+380501589860" className={s.callBtn}>
            <img src={logoPhone} alt="logo call" />
            {t('Call')}
          </a>
          <div>
            <p className={s.location}>{location}</p>
            <p className={s.createdAt}>{createdAt}</p>
          </div>
        </div>
      </div>

      <div>
        <h2 className={s.relatedAdsTitle}>{t('Related Ads')}</h2>
        <ul className={css.usedTentList}>
          {relatedTents.map((el, i) => (
            <li
              className={css.usedTentItem}
              key={el.title + i}
              onClick={handleClick}
            >
              <img
                className={css.usedTentImage}
                src={el.photo ? `${process.env.REACT_APP_API_URL}${el.photo}` : usedTent}
                alt={el.title}
              />
              <p className={css.tentTitle}>{el.title}</p>
              <p className={css.tentPrice}>{el.price} грн</p>
              <p className={s.tentLocation}>{el.location}</p>
              <p className={s.date}>{el.createdAt}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Announcement;
